INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT', 'Découvrez notre délicieux tajine de pruneaux, un plat traditionnel qui allie tendreté et saveurs exquises. Préparé avec des morceaux de viande mijotés lentement, des épices parfumées et des pruneaux sucrés, ce plat offre un équilibre parfait entre douceur et épices. Servi avec un accompagnement de semoule légère, il ravira vos papilles et vous plongera dans l''authenticité de la cuisine marocaine. À savourer sans modération !', '', false, 'Tajine de Pruneaux', 13.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT', 'Savourez notre ratatouille, un classique de la cuisine méditerranéenne qui met en avant la richesse des légumes de saison. Préparée avec des courgettes, des aubergines, des poivrons, des tomates et parfumée d''herbes aromatiques, cette recette colorée est mijotée à la perfection pour libérer toutes les saveurs. ', '', false, 'Ratatouille', 12.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT', 'Découvrez notre paella, un plat emblématique de la cuisine espagnole qui vous transporte directement sur les rives de la Méditerranée. Préparée avec du riz parfumé, des fruits de mer frais, du poulet juteux et des légumes colorés, cette recette est cuisinée avec un mélange d''épices qui lui donne une saveur unique. ', '', false, 'Paella', 15.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT', 'Savourez notre bœuf bourguignon, un classique de la gastronomie française qui allie tendreté et richesse des saveurs. Ce plat réconfortant est préparé avec des morceaux de bœuf mijotés lentement dans un délicieux vin rouge de Bourgogne, agrémenté de carottes, d''oignons, de champignons et d''herbes aromatiques.', '', false, 'Bœuf Bourguignon', 15.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT', 'Découvrez notre pizza Margherita, un hommage aux saveurs authentiques de l''Italie. Préparée avec une pâte fine et croustillante, elle est garnie de sauce tomate maison, de mozzarella fondante et de feuilles de basilic frais. Chaque bouchée offre un équilibre parfait entre la douceur de la tomate, la richesse du fromage et le parfum du basilic. ', '', false, 'Pizza Margherita', 13.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('PLAT_CHEF', 'Savourez notre pavé de saumon aux carottes, un plat léger et savoureux qui met en avant des ingrédients frais et sains. Le saumon, délicatement grillé ou poêlé, est accompagné de carottes fondantes, légèrement caramélisées et assaisonnées d''herbes aromatiques. Ce mélange offre une belle harmonie de textures et de saveurs.', '', false, 'Pavé de Saumon aux Carottes', 15.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('ENTREE_FROIDE', 'Taboulé
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('ENTREE_FROIDE', 'Découvrez notre carpaccio de bœuf, une entrée raffinée et délicate qui met en avant la qualité de la viande. Préparé avec des tranches fines de bœuf mariné, ce plat est assaisonné d''un filet d''huile d''olive, de jus de citron, et parsemé de copeaux de parmesan et de roquette fraîche. ', '', false, 'Carpaccio de Bœuf', 9, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('ENTREE_FROIDE', 'Découvrez notre salade Caprese, un classique de la cuisine italienne qui célèbre la simplicité et la fraîcheur des ingrédients. Composée de tranches de mozzarella di bufala crémeuse, de tomates mûres et juteuses, et de feuilles de basilic frais, cette salade est assaisonnée d''un filet d''huile d''olive extra vierge et d''une pincée de sel.', '', false, 'Salade Caprese', 7.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('BOISSON_CHAUDE', 'Café Espresso
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('BOISSON_CHAUDE', 'Découvrez notre thé vert, une infusion délicate et rafraîchissante qui offre une multitude de bienfaits pour la santé. Réputé pour ses propriétés antioxydantes, notre thé vert est élaboré à partir de feuilles soigneusement sélectionnées, qui préservent toute leur fraîcheur et leur saveur.', '', false, 'Thé Vert', 2.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('BOISSON_CHAUDE', 'Savourez notre café au lait, une boisson réconfortante qui allie la richesse d''un café bien dosé à la douceur du lait chaud. Préparé avec un espresso corsé et du lait crémeux, ce mélange est idéal pour démarrer la journée ou pour une pause café apaisante. Servi dans une grande tasse, notre café au lait peut être agrémenté d''une touche de sucre ou de cannelle selon vos préférences. ', '', false, 'Café au Lait', 2.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('DESSERT', 'Découvrez notre crème brûlée, un dessert français emblématique qui allie une texture crémeuse à un délicat croustillant. Préparée avec des jaunes d''œufs, de la crème, du sucre et une touche de vanille, notre crème brûlée est cuite lentement au bain-marie pour obtenir une consistance parfaite. Juste avant de servir, une fine couche de sucre est caramélisée pour créer une croûte dorée et croquante.', '', false, 'Crème Brûlée', 3.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('DESSERT', 'Savourez notre mousse au chocolat, un dessert décadent et aérien qui ravira les amateurs de chocolat. Préparée avec du chocolat noir de haute qualité, des œufs frais et une touche de crème fouettée, cette mousse est légère et onctueuse. Chaque bouchée offre une explosion de saveurs chocolatées, alliant intensité et douceur.', '', false, 'Mousse au Chocolat', 4.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('DESSERT', 'Découvrez notre tarte Tatin, un dessert français renversé qui met à l''honneur les pommes caramélisées. Préparée avec des pommes fondantes, du sucre et du beurre, cette tarte est cuite à l''envers pour créer une délicieuse croûte dorée et croustillante. Le caramel se forme pendant la cuisson, offrant une saveur riche et sucrée qui se marie parfaitement avec la douceur des pommes. ', '', false, 'Tarte Tatin', 5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('BOISSON_FROIDE', 'Rafraîchissez-vous avec notre thé glacé, une boisson estivale parfaite pour les journées chaudes. Préparé avec du thé noir ou vert, infusé à froid pour préserver toutes ses saveurs, notre thé glacé est ensuite sucré selon votre goût et agrémenté de tranches de citron, de feuilles de menthe ou d''autres fruits frais. Servi sur de la glace, il offre une sensation de fraîcheur et de légèreté.', '', false, 'Thé Glacé', 4.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('BOISSON_FROIDE', 'Rafraîchissez-vous avec notre thé glacé, une boisson estivale parfaite pour les journées chaudes. Préparé avec du thé noir ou vert, infusé à froid pour préserver toutes ses saveurs, notre thé glacé est ensuite sucré selon votre goût et agrémenté de tranches de citron, de feuilles de menthe ou d''autres fruits frais. Servi sur de la glace, il offre une sensation de fraîcheur et de légèreté.', '', false, 'Limonade Maison', 3.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('ENTREE_CHAUDE', 'Savourez notre bruschetta aux tomates, une entrée italienne classique qui met en valeur des ingrédients frais et savoureux. Préparée avec du pain grillé croustillant, elle est garnie de tomates mûres coupées en dés, d''ail émincé, de basilic frais, d''huile d''olive extra vierge et d''un soupçon de vinaigre balsamique. ', '', false, 'Bruschetta aux Tomates', 5.5, 'AVAILABLE');
INSERT INTO PUBLIC.DISH (CATEGORY, DESCRIPTION, IMAGE, IS_SPECIAL_PRICE, NAME, PRICE, STATUS) VALUES ('ENTREE_CHAUDE', 'Découvrez notre soupe à l''oignon, un plat réconfortant et savoureux de la cuisine française. Préparée avec des oignons caramélisés lentement pour libérer leur douceur, cette soupe est rehaussée de bouillon de viande ou de légumes, puis assaisonnée avec des herbes aromatiques.', '', false, 'Soupe à l''Oignon', 5.5, 'AVAILABLE');
